create table web_position
(
    id                int auto_increment
        primary key,
    sort_position     int         not null,
    lift              int         not null,
    rotation          int         not null,
    incline           int         not null,
    rollrotation      int         not null,
    top_roll_speed    int         not null,
    bottom_roll_speed int         not null,
    user_id           int         not null,
    name              varchar(50) not null,
    game_id           int         null,
    before_delay      int         not null,
    matched           varchar(1)  not null,
    constraint web_position_game_id_5f348234_fk_web_game_id
        foreign key (game_id) references web_game (id),
    constraint web_position_user_id_7e06e9eb_fk_auth_user_id
        foreign key (user_id) references auth_user (id)
);

create index web_position_6072f8b3
    on web_position (game_id);

